class Solution:
    def maxOperations(self, s: str) -> int:
        ans=0
        ct=0
        l=len(s)
        i=0
        while i<l:
            if s[i]=='0':
                ans+=ct
                while i<l and s[i]=='0':
                    i+=1
            else:
                ct+=1
                i+=1
        return ans
